import React from 'react';
import Pictures from './Pictures';



function Pic() {
    return (
        <div>
            <Pictures p={{
                media: 'Facebook',
                id: 'facebook',
                img: 'data:image/jpeg;base64,'
            }} />
            <Pictures p={{
                media: 'Facebook',
                id: 'facebook',
                img: 'https://picsum.photos/60'
            }} />
            <Pictures p={{
                media: 'Facebook',
                id: 'facebook',
                img: 'https://picsum.photos/60'
            }} />
            <Pictures p={{
                media: 'Facebook',
                id: 'facebook',
                img: 'https://picsum.photos/60'
            }} />
        </div>
    )
}

export default Pic;
